"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[3108],{3108:a=>{a.exports=JSON.parse('{"lessonId":"A2_U10","title":"\u0423\u0440\u043e\u043a 10: \u0414\u0440\u0443\u0433\u0438\u0435 \u0441\u043b\u0443\u0447\u0430\u0438 \u0443\u043f\u043e\u0442\u0440\u0435\u0431\u043b\u0435\u043d\u0438\u044f \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0451\u043d\u043d\u043e\u0433\u043e \u0430\u0440\u0442\u0438\u043a\u043b\u044f","level":"A2","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0410\u0440\u0442\u0438\u043a\u043b\u044c \u0441 \u0438\u0433\u0440\u0430\u043c\u0438, \u044f\u0437\u044b\u043a\u0430\u043c\u0438, \u043d\u0430\u0443\u043a\u0430\u043c\u0438 \u0438 \u0447\u0430\u0441\u0442\u044f\u043c\u0438 \u0442\u0435\u043b\u0430","content":[{"text":"<strong>\u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f `el, la, los, las` \u0432 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0445 \u0441\u043b\u0443\u0447\u0430\u044f\u0445:</strong>"},{"list":["<strong>- tocar el piano, la guitarra...</strong><br><i>Ana est\xe1 aprendiendo a tocar <strong>el</strong> piano.</i><br><strong>\u041d\u041e:</strong> tener, necesitar, comprar <strong>un</strong> piano, <strong>una</strong> guitarra...<br><i>Tengo <strong>una</strong> guitarra espa\xf1ola.</i>","<strong>- jugar al f\xfatbol, al tenis, al ajedrez, a las cartas...</strong><br><i>\xbfSabes jugar <strong>al</strong> ajedrez?<br>Jugamos <strong>al</strong> f\xfatbol todos los domingos.</i><br><strong>\u041d\u041e:</strong> hacer gimnasia, nataci\xf3n, alpinismo.<br><i>Hago <strong>gimnasia</strong> todas las ma\xf1anas.</i>","<strong>- las matem\xe1ticas, la lengua, el griego, el espa\xf1ol...</strong><br><i>Mi asignatura preferida son <strong>las matem\xe1ticas</strong>.<br><strong>El griego</strong> es una lengua muy sonora.</i><br><strong>\u041d\u041e:</strong> \u041d\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0441 \u0433\u043b\u0430\u0433\u043e\u043b\u0430\u043c\u0438 hablar, saber, ense\xf1ar, estudiar...<br><i>\xbfUsted habla <strong>chino</strong>?<br>Clara estudia <strong>Filosof\xeda</strong>.</i>"]}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0410\u0440\u0442\u0438\u043a\u043b\u044c \u0441 \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c\u0438 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442\u0430\u043c\u0438 \u0438 \u043c\u0435\u0441\u0442\u0430\u043c\u0438","content":[{"text":"<strong>\u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f `el, la, los, las` \u0432 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0445 \u0441\u043b\u0443\u0447\u0430\u044f\u0445:</strong>"},{"list":["<strong>- la polic\xeda, el ej\xe9rcito, los bomberos.</strong><br><i>El t\xedo de Andr\xe9s es capit\xe1n d<strong>el ej\xe9rcito</strong>.<br>Luis quiere ingresar en <strong>la polic\xeda</strong>.</i>","<strong>- la radio, la televisi\xf3n, el peri\xf3dico, las noticias.</strong><br><i>Me gusta escuchar m\xfasica en <strong>la radio</strong>.<br>Siempre escuchamos <strong>las noticias</strong> de las nueve.</i><br><strong>\u041d\u041e:</strong> una radio, una televisi\xf3n (aparatos), una noticia.<br><i>Tengo <strong>una radio</strong> nueva. (un aparato)<br>Me he comprado <strong>una televisi\xf3n</strong>. (un aparato)</i>","<strong>- el mar, el campo, la playa, el cielo, la naturaleza.</strong><br><i>Vamos al campo los fines de semana.<br>Hay que proteger <strong>la naturaleza</strong>.</i>","<strong>- ir al..., venir del..., estar en el... hospital, cine, teatro, dentista, m\xe9dico, banco, aeropuerto, lavabo, trabajo, colegio.</strong><br><i>\xbfPuedo ir <strong>al</strong> servicio, por favor?<br>La madre de Rosa est\xe1 en <strong>el</strong> hospital.<br>Mis padres van hoy <strong>al</strong> teatro.</i>","<strong>- ir a la..., venir de la..., estar en la... iglesia, universidad, c\xe1rcel, oficina.</strong><br><i>Mi hermana est\xe1 en <strong>la</strong> universidad.<br>Los domingos voy a <strong>la</strong> iglesia.</i><br><strong>\u041d\u041e:</strong> ir a..., venir de... / estar en... <strong>casa, correos, clase</strong>.<br><i>Voy a correos a enviar un paquete.<br>Edgar est\xe1 en <strong>casa</strong> desde las doce.</i>"]}]},{"type":"TheoryBlock","title":"\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435: \u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 10.1","content":[{"text":"<strong>\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 10.1 \u043f\u0440\u043e\u043f\u0443\u0449\u0435\u043d\u043e, \u0442\u0430\u043a \u043a\u0430\u043a \u043e\u043d\u043e \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043e \u043d\u0430 \u0430\u043d\u0430\u043b\u0438\u0437\u0435 \u0438\u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u0439.</strong>"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 10.2: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0441 el, la, los, las, del, al \u0438\u043b\u0438 un, una, unos, unas","tasks":[{"id":"u10_2_1","sentence":"1. \xa1Fuego! Llamad a ___ bomberos.","answer":"los"},{"id":"u10_2_2","sentence":"2. \xbfHablas ___ espa\xf1ol?","answer":""},{"id":"u10_2_3","sentence":"3. ___ griego no es dif\xedcil.","answer":"El"},{"id":"u10_2_4","sentence":"4. Este fin de semana vamos a ___ playa.","answer":"la"},{"id":"u10_2_5","sentence":"5. \xbfHas escuchado ___ noticias?","answer":"las"},{"id":"u10_2_6","sentence":"6. Susana estudia ___ Arquitectura.","answer":""},{"id":"u10_2_7","sentence":"7. Merche hace ___ gimnasia en el colegio.","answer":""},{"id":"u10_2_8","sentence":"8. El padre de Pepe es general de ___ ej\xe9rcito.","answer":"del"},{"id":"u10_2_9","sentence":"9. ___ Historia es una asignatura apasionante.","answer":"La"},{"id":"u10_2_10","sentence":"10. Los Mart\xedn tienen una casa en ___ campo.","answer":"el"},{"id":"u10_2_11","sentence":"11. Antonio tiene ___ guitarra el\xe9ctrica.","answer":"una"},{"id":"u10_2_12","sentence":"12. He comprado ___ televisi\xf3n.","answer":"una"},{"id":"u10_2_13","sentence":"13. Escucho ___ radio por las ma\xf1anas.","answer":"la"},{"id":"u10_2_14","sentence":"14. \xa1Un ladr\xf3n! Llama a ___ polic\xeda.","answer":"la"},{"id":"u10_2_15","sentence":"15. Siempre leo ___ peri\xf3dico despu\xe9s de desayunar.","answer":"el"}]},{"type":"TheoryBlock","title":"\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435: \u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 10.3","content":[{"text":"<strong>\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 10.3 \u043f\u0440\u043e\u043f\u0443\u0449\u0435\u043d\u043e, \u0442\u0430\u043a \u043a\u0430\u043a \u043e\u043d\u043e \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043e \u043d\u0430 \u0430\u043d\u0430\u043b\u0438\u0437\u0435 \u0438\u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u0439.</strong>"}]}]}')}}]);